INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("ペコリーヌとの出会い", "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 0, "フリーマーケット会場", 7, 2834, "青空の下で謁見", 91002, 2, 40, 10118, 8, 1, 20063115, 5118061);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("マホとの出会い", "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 0, "フリーマーケット会場", 7, 2835, "未来の騎空団\nマスコット？", 91002, 2, 40, 10118, 8, 1, 20063115, 5118062);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("アキノとの出会い", "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 0, "ランドソル市街地", 7, 2837, "お嬢さまからの\n緊急依頼", 91002, 2, 40, 10118, 8, 1, 20063115, 5118063);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("ジュンとの出会い", "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 0, "フリーマーケット会場", 18, 4108402, "黄金色の悩みごと", 91002, 2, 40, 10118, 8, 1, 20063115, 5118064);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("カオリとの出会い", "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 0, "フリーマーケット会場", 18, 4107402, "白熱！　格闘大会！", 91002, 2, 40, 10118, 8, 1, 20063115, 5118065);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("ニノンとの出会い", "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, "オーエド町", 16, 9000227, "祭り太鼓はオーエドの華", 91002, 2, 40, 10118, 8, 1, 20063115, 5118066);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("スズナとの出会い", "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 0, "フリーマーケット会場", 19, 2101181, "人気者は遅れて\nやってくる", 91002, 3, 40, 10118, 8, 1, 20063115, 5118067);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("ナナカとの出会い", "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 0, "ランドソル市街地", 18, 4109402, "巫女・ミーツ・魔法少女", 91002, 3, 40, 10118, 8, 1, 20063115, 5118068);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("キャル＆コッコロとの出会い", "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 0, "フリーマーケット会場", 18, 4305402, "ネズ耳は二度なくなる", 91002, 3, 40, 10118, 8, 1, 20063115, 5118069);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("ユカリとの出会い", "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 0, "ランドソル市街地", 18, 4101402, "この出会いにカンパイ！", 91002, 3, 40, 10118, 8, 1, 20063115, 5118070);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("アオイとの出会い", "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 0, "ランドソル市街地", 18, 4106402, "陰陽アンサンブル", 91002, 3, 40, 10118, 8, 1, 20063115, 5118071);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("シノブとの出会い", "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, "フリーマーケット会場", 7, 2836, "運試し十番勝負！", 91002, 3, 40, 10118, 8, 1, 20063115, 5118072);
INSERT INTO `v1_2b2b6a7eb30db423bfa9ea7d4feadfab9fad672a1d75c147d50529e5f3c0a74c` VALUES ("オープニング", 0, 0, 0, 0, 0, "彼女たちの新たな日常", 0, 1, 0, 10118, 0, 0, 20063115, 5118600);
